// src/components/WebGazerSetup.js
import WebGazer from 'webgazer';

const initializeWebGazer = () => {
  if (!WebGazer.isReady) {
    console.log('Initializing WebGazer...');
    WebGazer.setGazeListener((data, elapsedTime) => {
      if (data) {
        console.log('Gaze position:', data.x, data.y);
      }
    }).begin();
  } else {
    console.warn('WebGazer is already initialized.');
  }
};

const stopWebGazer = () => {
  if (WebGazer.isReady) {
    console.log('Stopping WebGazer...');
    WebGazer.end();
  } else {
    console.warn('WebGazer is not ready or has already been stopped.');
  }
};

export { initializeWebGazer, stopWebGazer };
